import React, { useState, useEffect } from "react";
import rentServices from "../services/rentServices";
import carServices from "../services/carServices";
import userServices from "../services/usernameServices";
import { Link } from 'react-router-dom';

const RentCreate = () => {
    const initialRentState = {
        id_rent: null,
        username: null,
        car: null,
        dateRent: ""
    }

    const [Rent, setRent] = useState(initialRentState);
    const [RentArray, setRentRentArray] = useState([]);
    const [Username, setUsername] = useState([]);
    const [User, setUser] = useState(null);
    const [Car, setCar] = useState([]);
    const [CarSelect, setCarSelect] = useState(null);
    const [Validat, setValidat] = useState(false);
    const [errors, setErrors] = useState({});
    const [errorsDateAndUser, setErrorsDateAndUser] = useState({});

    const handleInputChange = event => {
        const { name, value } = event.target;
        setRent({ ...Rent, [name]: value });
    }

    const handleInputblur = event => {
        setUser(JSON.parse(event.target.value));
        setErrorsDateAndUser(validationErrorsDateAndUser(User));
        setCarSelect(JSON.parse(event.target.value));
        setErrors(validationError(CarSelect));
    }

    useEffect(() => {
        getListUser();
        getListCar();
        getListRent();
        if (Validat)
            newRent();
    }, [Validat]);

    const getListUser = () => {
        userServices.getAll()
            .then(response => {
                setUsername(response.data);
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });
    };

    const getListCar = () => {
        carServices.getAll()
            .then(response => {
                setCar(response.data);
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });
    };

    const getListRent = () => {
        rentServices.getAll()
            .then(response => {
                setRentRentArray(response.data);
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });
    };

    const createRent = (e) => {
        e.preventDefault();
        var data = { id_rent: Rent.id_rent, username: User, car: CarSelect, dateRent: Rent.dateRent }

        setErrorsDateAndUser(validationErrorsDateAndUser(User));
        setErrors(validationError(CarSelect));
        if (Object.keys(errors).length === 0) {
            rentServices.create(data)
                .then(response => {
                    setRent({ username: response.data.User, car: response.data.CarSelect, dateRent: response.data.dateRent });
                    setValidat(true);
                    console.log(response.data);
                })
                .catch(e => {
                    console.log(e);
                })
        } else {
            console.log("puta sal")
        }
    }

    const newRent = () => {
        setRent(initialRentState);
        setUsername([]);
        setCar([]);
        setValidat(false);
    }

    const validationError = (CarSelect) => {
        let errors = {};

        RentArray.forEach(rent => {
            if (rent.car.idCar === CarSelect.idCar) {
                errors.CarSelect = "Vehículo ya alquilado";
                console.log(errors + "Vehículo ya alquilado")
            }
        });

        return errors;
    }

    const validationErrorsDateAndUser = (User) => {
        let errorsDateAndUser = {};

        RentArray.forEach(rent => {
            if (rent.username.idUser === User.idUser) {
                errorsDateAndUser.User = "El usuario ya alquilado un vehiculo para esta fecha";
                console.log(errorsDateAndUser + "El usuario ya alquilado un vehiculo para esta fecha")
            }
        });

        return errorsDateAndUser;
    }

    return (
        <div className="submit-form">
            <div className="card">
                <div className="card-body">
                    <h4>Alquilar</h4>
                    <blockquote className="blockquote mb-0">
                        <form onSubmit={createRent} className="row g-3 needs-validation my-3 border = 1">
                            <div className="form-group">
                                <label htmlFor="username" className="form-label">
                                    <i className="bi bi-person-add"></i>Usuario
                                </label>
                                <div className="form-group">
                                    <select
                                        className={((errorsDateAndUser.User) ? "is-invalid" : "") + " form-select"}
                                        name="username"
                                        id="username"
                                        onBlur={handleInputblur}
                                        onChange={e => {
                                            setUser(JSON.parse(e.target.value));
                                        }}
                                    >
                                        <option selected>Seleccioné un Usuario</option>
                                        {Username && Username.map(
                                            (username) => (
                                                <option value={JSON.stringify(username)}>{username.username}</option>
                                            ))}
                                    </select>
                                    <small className="invalid-feedback" id="helpId">
                                        <i className="bi bi-exclamation-circle"> {errorsDateAndUser.User}</i>
                                    </small>
                                </div>
                            </div>
                            <div className="form-group">
                                <label htmlFor="car" className="form-label">
                                    <i className="bi bi-car-front-fill"></i>Vehículo
                                </label>
                                <div className="form-group">
                                    <select
                                        className={((errors.CarSelect) ? "is-invalid" : "") + " form-select"}
                                        name="car"
                                        id="car"
                                        onBlur={handleInputblur}
                                        onChange={e => {
                                            setCarSelect(JSON.parse(e.target.value));
                                        }}
                                    >
                                        <option selected>Seleccioné un Vehículo</option>
                                        {Car && Car.map(
                                            (car) => (
                                                <option value={JSON.stringify(car)}>{car.licencePlate}</option>
                                            ))}
                                    </select>
                                    <small className="invalid-feedback" id="helpId">
                                        <i className="bi bi-exclamation-circle"> {errors.CarSelect}</i>
                                    </small>
                                </div>
                            </div>
                            <div className="col-md-3 position-relative">
                                <label htmlFor="dateRent" className="form-label">
                                    <i className="bi bi-calendar-date"></i> Fecha
                                </label>
                                <div className="input-group has-validation">
                                    <span className="input-group-text">
                                        <i className="bi bi-pencil-square"></i>
                                    </span>
                                    <input
                                        type="date"
                                        className="form-control"
                                        id="dateRent"
                                        value={Rent.dateRent}
                                        onChange={handleInputChange}
                                        name="dateRent"
                                        required
                                    />
                                </div>
                            </div>
                            <div className="col-12">
                                <button className="btn btn-secondary my-3 mx-2" type="submit">
                                    <i className="bi bi-person-plus"> Alquilar</i>
                                </button>
                                <Link className="btn btn-danger" to={"/RentList"}>
                                    <i className="bi bi-x-circle"> Cancelar</i>
                                </Link>
                            </div>
                        </form>
                    </blockquote>
                </div>
            </div>
        </div>
    );
};

export default RentCreate;
